import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Nav from './components/Nav/Nav';
import { Route, BrowserRouter } from "react-router-dom";
import Messages from './components/Article/Messages/Messages';
import Profile from './components/Article/Profile/Profile';
import News from './components/Article/News/News';
import Friends from './components/Article/Friends/Friends';
import Settings from './components/Article/Settings/Settings';


// let ProfileInf = () => <Profile/> 2ой

const App = (props) => {

  let usersData = [
    { id: 1, name: 'John' },
    { id: 2, name: 'Jesus' },
    { id: 3, name: 'Jacob' },
    { id: 4, name: 'Jessica' },
    { id: 5, name: 'Jane' },
];
let messageData = [
    { id: 1, message: 'Huylow' },
    { id: 2, message: 'Я хожу по воде' }, 
    { id: 3, message: 'Жакоб или Якоб?' },
    { id: 4, message: 'Альба?' },
    { id: 5, message: 'Fuck' },
];

  return (
    <BrowserRouter>
      <div className="app-wrap">
        <Header />
        <Nav />
        <article className="article">
          {/* <Route path="/profile" component={Profile} />  1ый способ рендерить
              <Route path="/profile" component={ ProfileInf } /> 2ой
              <Route path="/profile" render={ () => <Profile/>} /> 3ий 

          {/* <Route exact path="/messages" component={Messages} /> строго указаный путь */}


          <Route path="/profile" render={ () => <Profile/>} />
          <Route path="/messages" render={ () => <Messages usersData={usersData} messageData={messageData}/>} />
          <Route path="/news" render={ () => <News/>} />
          <Route path="/friends" render={ () => <Friends/>} />
          <Route path="/settings" render={ () => <Settings/>} />

        </article>
      </div>
    </BrowserRouter>
  );
}


export default App;
